import React, { Component } from "react";
import Navbar from "./navbar";
import "./App.css";
import userlogo from "./user.png";
import background from "./asfalt-dark.png";
import "bootstrap/dist/css/bootstrap.min.css";
import { withStyles } from "@material-ui/core";

const styles = theme => ({
    multilineColor: {
        color: "white"
    }
});

const StyledButton = withStyles({
    root: {
        "& .MuiOutlinedInput-root .MuiOutlinedInput-notchedOutline": {
            borderWidth: "2px",
            borderRadius: "20px",
            borderColor: "white"
        },
        "&:hover .MuiOutlinedInput-root .MuiOutlinedInput-notchedOutline": {
            borderWidth: "2px",
            borderRadius: "20px",
            borderColor: "red"
        },
        "& .MuiOutlinedInput-root.Mui-focused .MuiOutlinedInput-notchedOutline": {
            borderWidth: "2px",
            borderRadius: "20px",
            borderColor: "green"
        }
    }
})(TextField);

const StyledButton1 = withStyles({
    root: {
        "& .MuiOutlinedInput-root .MuiOutlinedInput-notchedOutline": {
            borderWidth: "2px",
            borderRadius: "20px",
            borderColor: "white"
        },
        "&:hover .MuiOutlinedInput-root .MuiOutlinedInput-notchedOutline": {
            borderWidth: "2px",
            borderRadius: "20px",
            borderColor: "red"
        },
        "& .MuiOutlinedInput-root.Mui-focused .MuiOutlinedInput-notchedOutline": {
            borderWidth: "2px",
            borderRadius: "20px",
            borderColor: "green"
        },
        marginLeft: "145px"
    }
})(TextField);
var sectionStyle = {
    backgroundImage: "url(" + background + ")"
};

export default class App extends Component{
    render(){
        return (
            <React.Fragment>
                <img src={background} className="main" />
                <div className="main">
                    <Navbar></Navbar>
                    <title>Add User</title>
                    <link rel="stylesheet" type="text/css" href="App.css" />
                    <div className="loginbox">
                        <img src={userlogo} className="user" />
                        <h1>ADD SQL STATEMENT</h1>
                        <form>
                            <p>Enter here :</p>
                            <br></br>
                            <textarea
                                type="textarea"
                                rows="4"
                                cols="30"
                                name="address"
                                placeholder="Enter Address"
                                required
                            />
                            <br></br>
                            <br></br>
                            <button class="button button1">Add Committee</button>
                        </form>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
App = withStyles(styles)(App);
